👉 Si presentas alguna hipoglucemia o hiperglucemia es importante mantener informado a tu doctor por si se debe hacer un ajuste en tu tratamiento. Si al momento de medir tu glucosa te notificó abajo u arriba de los rangos, es importante su medición durante el día, al menos cada 1 a 2 hrs durante el día. Recuerda que existe varios factores que pueden influir.

👉 Si tu glucosa sale por arriba de 300 mg/dl, y cuentas para realizar medición de cetonas, si la presencia de cetonas son positivas evita realizar ejercicio, toma mucha agua pura. Es importante mantener informado a tu doctor, es importante realizar ajustes en tu tratamiento.

😉 Si planeas realizar una actividad física duradera (sobretodo pacientes con diabetes tipo 1) es importante realizar chequeo de tu glucosa cada 30 min. O una medida de prevención es el consumo de un snack a los 30 min que nos aporte 15 g de hidratos de carbono depende la actividad, ejemplo 2 galletas de arroz, 1 fruta, entre otros. Puedes agregar una grasa buena como 1 cda de crema de cacahuate sin azúcar.

😉 Cada persona es diferente, así como sus objetivos, estilo de vida entre otros, por ello es importante llevar un plan de alimentación individualizado acorde a tu tratamiento y estilo de vida, por ello es importante asesorarte con un nutriologo, lo cual podría ayudarte. 😉 Espero te haya sido de utilidad. 

